    public void ShowHideEmergencyCheckList()
    {
        Description = null;
        emergencyCheckListSideModal = !emergencyCheckListSideModal;
    }
    public void ShowEmergencyCheckList(List<FMSEmergencyCheckVM> checkVMs)
    {
        emergencyCheckListSideModal = true;
